import React from 'react';
import NavbarTop from './NavbarTop';
import lessonincomplete from '../img/lessonincomplete.svg';
import '../App.css';

function Dashboard() {
	return (
		<header>
			<NavbarTop />
			<h2>Dashboard</h2>
			<div style={styles.lessonsElement}></div>
			<img src={lessonincomplete} style={styles.lessonsElement} />
			<span style={styles.defaultFontFamily}>Lesson 1</span>
		</header>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonsElement: {
		borderRadius: '50%',
		background: '#dae1e7ff'
	}
};
export default Dashboard;
